.github-PrCommitView-container {
  display: flex;
  align-items: center;
  padding: 10px;
  font-size: 12px;
  border: 1px solid transparent;
  border-bottom: none;
}
.github-PrCommitView-container:first-child {
  border-top-left-radius: 0.125rem;
  border-top-right-radius: 0.125rem;
}
.github-PrCommitView-container:last-child {
  border-bottom: 1px solid transparent;
  border-bottom-left-radius: 0.125rem;
  border-bottom-right-radius: 0.125rem;
}
.github-PrCommitView-commit {
  flex: 1;
}
.github-PrCommitView-messageHeadline.is-button {
  padding: 0;
  margin-right: 6.66666667px;
  background-color: transparent;
  border: none;
  cursor: pointer;
  text-align: left;
  color: #FFFFFF;
}
.github-PrCommitView-messageHeadline.is-button:hover,
.github-PrCommitView-messageHeadline.is-button:focus {
  color: rgba(255, 255, 255, 0.675);
}
.github-PrCommitView-title {
  margin: 0 0 .25em 0;
  font-size: 1.2em;
  line-height: 1.4;
}
.github-PrCommitView-avatar {
  border-radius: 0.125rem;
  height: 16px;
  margin-right: .4em;
  width: 16px;
}
.github-PrCommitView-metaText {
  line-height: 16px;
  vertical-align: middle;
  color: rgba(255, 255, 255, 0.35);
}
.github-PrCommitView-moreButton {
  margin: 0 auto 0 10px;
  padding: 0em .2em;
  color: rgba(255, 255, 255, 0.35);
  font-style: italic;
  font-size: .8em;
  border: 1px solid transparent;
  border-radius: 0.125rem;
  background-color: #193549;
}
.github-PrCommitView-moreButton:hover {
  background-color: #20435c;
}
.github-PrCommitView-moreText {
  margin-top: 5px;
  padding: 0;
  font-size: inherit;
  font-family: var(--editor-font-family);
  word-wrap: initial;
  word-break: break-word;
  white-space: initial;
  background-color: transparent;
}
.github-PrCommitView-sha {
  margin-left: 10px;
  line-height: 16px;
  vertical-align: middle;
  color: #64B5F6;
  font-family: var(--editor-font-family);
}
.github-PrCommitView-sha a {
  color: inherit;
}
